import { useEffect, useState } from "react";
import Navbarcomponent from "../navbar";
import axios from "axios";
import { Card, Row } from "react-bootstrap";
import { useParams } from "react-router";

function BookingStatus() {
  const [customerBook, setCustomerBook] = useState([]);
  const { id } = useParams();

  useEffect(() => {
    axios.get(`http://localhost:8182/customerBook/customerid/${id}`)
      .then((response) => {
        console.log("API response:", response.data);
        setCustomerBook(response.data);
      })
      .catch((error) => console.error("Error fetching customer books:", error));
  }, [id]);

  return (
    <div>
      <Navbarcomponent />
      <Row>
        <table className="table">
          <thead>
            <tr>
              <th>Name</th>
              <th>ID</th>
              <th>Issue Date</th>
              <th>Return Date</th>
              <th>Fine</th>
            </tr>
          </thead>
          <tbody>
            {customerBook.map((cb, index) => (
              <tr key={index}>
                <td>{cb.customer.name}</td>
                <td>{cb.id}</td>
                <td>{cb.issueDate}</td>
                <td>{cb.returnDate}</td>
                <td>{cb.amount}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </Row>
    </div>
  




   
  );
}

export default BookingStatus;
